<!DOCTYPE html>
<html lang="en">

<head>
    <style>
        html,
        body {
            background-color: white;
        }

        .theia-preload {
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            /* Above styles copied from https://github.com/eclipse-theia/theia/blob/5aeef6c0c683b4e91713ab736957e6655b486adc/packages/core/src/browser/style/index.css#L147-L151 */
            /* Otherwise, there is a flickering when Theia's CSS loads. */

            background-image: none;
        }

        .theia-preload::after {
            /* remove default loading animation */
            content: none;
        }

        .spinner-container {
            display: flex;
            flex-direction: center;
            align-self: center;
            justify-content: center;
            height: 100vh;
            width: 100vw;
        }

        .custom-spinner {
            align-self: center;
        }

        .custom-spinner svg {
            width: 80vw;
            height: 50vh;
            animation-delay: 0;
            animation-duration: 2s;
            animation-iteration-count: infinite;
            animation-name: theia-ide-spinner;
            animation-timing-function: ease;
        }

       @keyframes theia-ide-spinner {
            0% {
                filter: brightness(103%) contrast(101%);
                transform: scale(1.5);
            }

            50% {
                filter: invert(57%) sepia(52%) brightness(100%) contrast(102%);
                transform: scale(0.6);
            }

            100% {
                filter: brightness(103%) contrast(101%);
                transform: scale(1.5);
            }
        }
    </style>
</head>
